function Navbar() {
  return (
    <nav className="bg-white shadow-md py-4">
      <div className="container mx-auto flex justify-between items-center px-6">
        <h1 className="text-2xl font-bold text-gray-800">Pavithran</h1>
        <div className="space-x-6">
          <Link to="/" className="hover:text-pink-600">Home</Link>
          <Link to="/about" className="hover:text-pink-600">About</Link>
          <Link to="/projects" className="hover:text-pink-600">Projects</Link>
          <Link to="/experience" className="hover:text-pink-600">Experience</Link>
          <Link to="/education" className="hover:text-pink-600">Education</Link> {/* âœ… New */}
          <Link to="/research" className="hover:text-pink-600">Research</Link>
          <Link to="/skills" className="hover:text-pink-600">Skills</Link>
          <Link to="/contact" className="hover:text-pink-600">Contact</Link>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
